	@Inject
	public SimplepalladioGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pModel = new ModelElements();
		this.pRepositoryViewType = new RepositoryViewTypeElements();
		this.pAbstractRepositoryElement = new AbstractRepositoryElementElements();
		this.pInterfaceCommunicator = new InterfaceCommunicatorElements();
		this.pAbstractComponent = new AbstractComponentElements();
		this.pBehaviorElement = new BehaviorElementElements();
		this.pEString = new EStringElements();
		this.pInterface = new InterfaceElements();
		this.pCompositeComponent = new CompositeComponentElements();
		this.pSignature = new SignatureElements();
		this.pComponent = new ComponentElements();
		this.eType = new TypeElements();
		this.pParameter = new ParameterElements();
		this.pService = new ServiceElements();
		this.pBehaviourDescription = new BehaviourDescriptionElements();
		this.pInternalAction = new InternalActionElements();
		this.pExternalCall = new ExternalCallElements();
		this.pLoop = new LoopElements();
		this.pBranch = new BranchElements();
		this.pAssemblyViewType = new AssemblyViewTypeElements();
		this.pAbstractSystemElement = new AbstractSystemElementElements();
		this.pSystem = new SystemElements();
		this.pAssemblyContext = new AssemblyContextElements();
		this.pRole = new RoleElements();
		this.pDelegationConnector = new DelegationConnectorElements();
		this.pAssemblyConnector = new AssemblyConnectorElements();
		this.pEnvironmentViewType = new EnvironmentViewTypeElements();
		this.pAbstractEnvironmentElement = new AbstractEnvironmentElementElements();
		this.pContainer = new ContainerElements();
		this.pLink = new LinkElements();
		this.pAllocationViewType = new AllocationViewTypeElements();
		this.pAllocationContext = new AllocationContextElements();
		this.pQualifiedName = new QualifiedNameElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.xtext.mdsm.simplePalladio.Simplepalladio".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
